◆ 　オニキスは、持ち主の意志の力を強くさせ、正しい判断力を与え、他人の悪意を跳ね返して身を守る「自己防衛の石」と呼ばれます。強力な魔よけや邪気払いのパワーストーン　
◆ こんな時・人におすすめ ○ 新しい出会いが欲しい ○ 新しいチャンスを求めている ○ 周囲の影響から身を守りたい ○ 決別のときのお守りが欲しい ○ パートナーシップを高めたい ○ 意志を強固にし目標を達成したい ○ 集中力を高めたい ○ ネガティブな感情を鎮めたい ○ 悪い誘惑や欲望を断ち切りたい ○ 新しい自分に生まれ変わりたい ○ 魔よけのお守り石が欲しい ○ よくスポーツをする 　   <br><style type="text/css">
